import styles from "../styles/homepage.module.css"

export default function Home() {
  return <Welcome />
}


function  Welcome() {
  return (
    <div id={styles.welcome}>
    <h1 id="wc">Welcome</h1>
    <h1 id="to">to</h1>
    <h1 id="chat">Chatify</h1>
    </div>
  )
}
